    "description": "The following are your choices and brief description;\r\n\r\nORIGINAL- unscented\r\n\r\nSANDALWOOD- sandalwood essential oil mixed with vanilla essential oil\r\n\r\nAVALANCHE- Cypress, Cedarwood, Lemon, Rosemary, Patchouli, Tea Tree, Mandarin essential oils. Has a cool, earthy smell.\r\n\r\nEARTHEN- Rosewood Essential Oil, Cedarwood Essential Oil, Patchouli Essential Oil, and Ylang Ylang essential Oil.\r\n\r\nCEDARWOOD- cedarwood essential oil\r\n\r\nBERGAMOT- bergamot essential oil has a citrus smell\r\n\r\nTEAKWOOD- This is a fragrance, not an essential oil. Scent is; Falling Leaves, Fresh Citrus, Fireside Warmth, Indonesian Teakwood, Patchouli, Amber\r\n\r\nTOBACCO- This is a fragrance, not an essential oil. Smells of Pipe tobacco.\r\n\r\nFIR NEEDLE- fir needle essential oil\r\n\r\nPATCHOULI- patchouli essential oil\r\n\r\nCLOVE- Clove essential oil\r\n\r\nMOTHER EARTH- Bergamot, Cassia Root, Cedarwood, Nutmeg, Lavadin, and peppermint essential oils. This scent is a minty earth scent.\r\n\r\nBAY RUM- This is a fragrance, not an essential oil. Fresh essence of bay leaves with the bright enjoyment of orange peel and zest.\r\n\r\nOAKMOSS -Wet and earthy oakmoss with green vetiver, vanilla and nutmeg.\r\n\r\nBARBER SHOP- This scent smells of vibrant Bergamot and fresh basil leaf complimented by earthy notes of Oakmoss and white patchouli.\r\n\r\nCEDARWOOD SAGE- This essential oil is a perfect blend of Cedarwood essential oil with Sage essential oil.\r\n\r\nTRINITY- This essential oil is a perfect blend of Cedarwood, Sage, and Rosemary Essential oils thus forming Trinity.  \r\n\r\n\r\n- The Beard Balm and Beard Oil work great together and is perfect for your daily routine.  Apply a few drops of beard oil to a freshly washed, towel dried beard.  After, use some of the Beard Balm to deep condition your beard without making it greasy.  \r\n-Our Beard Balm helps nourish and condition your beard while providing a light hold.  The ingredients in the balm promote growth and helps prevent breakage.  \r\n\r\n\r\n*we also have a 0.5oz bottle set which is great to start as a tester to see if you like our product. \r\n\r\n**********************************************\r\nWe are a small husband and wife business running out of our home in Cleveland, Ohio. We strive to make the best products with the best ingredients to keep you coming back for more. All our products are hand poured and hand made from small batches to keep everything fresh for your benefit. If you have any questions on our products or any feedback, please feel free to send us a convo. \r\n***********************************************\r\n~Argan Oil: Argan oil is often referred to as a miracle product or liquid gold because of its extreme moisturising benefits for both hair and skin. Unlike other oils, Argan extracts don\u2019t just temporarily mask dryness. The kernels contain vitamin E to restore each strand of hair and keep it moisturised long after use. At the same time, Argan oil helps to naturally restore the hair cuticle. This is made possible by the natural presence of antioxidants that directly reverse cellular damage. It Contains unsaturated fats omega 3 and omega 9 which helps prevent split ends by strengthening the protein bonding structures of the hair.\r\n\r\n~Jojoba oil: Is fantastic for beards because of its ability to strengthen and moisturize facial hair. Because it is nontoxic and non-allergenic, Jojoba oil does not leave behind a greasy build up so you can use it on a daily basis. And unlike synthetic products that strip your hair of its natural oils, Jojoba oil actually strengthens and enhances your beard\u2019s natural oils and decreases the chance of breakage. Jojoba oil will help keep your beard soft, healthy and manageable.\r\n\r\n~Avocado Oil: Avocado oil is good for moisturizing dry, brittle, and damaged hair. It has a light weight formula that\u2019s easily absorbed into the hair without clogging your pores. It contains many nutrients such as vitamins A, B, D, E, protein, amino acids, iron, copper, magnesium, and folic acid. All these nutrients are beneficial for nourishment and hair growth. It has natural humectant properties adding and locking in moisture. It\u2019s also great for deep conditioning, strengthening hair, and adding shine. The vitamins, amino acids, and high fat content promote healthy cell growth and are great for maintaining and restoring beard health.\r\nVitamin E: promotes the production of sebum, a natural oil that is produced by our bodies and lubricates and moisturizes hair, making it look thicker and more lush.\r\n\r\nBeard Oil Ingredients: Ingredients: Argan Oil, Avocado Oil, Jojoba oil, Vitamin E, Fragrance Oil\r\n*Directions: Massage a small amount into hands and then apply to beard.\r\n\r\nMustache Wax Ingredients: Soybean Oil, Sunflower Oil, Beeswax, Hemp Oil, Avocado Oil, Jojoba Oil, Cocoa Butter, Shea Butter, Vitamin C, Aloe Vera, and Essential Oil\r\n*Directions: Rub a small amount onto fingers and then style. A small amount will go a long way.\r\n\r\n\r\n\r\nBeardology:\r\nhttps:\/\/www.etsy.com\/shop\/KehoeNaturals?section_id=13701422\r\n\r\nGift Sets:\r\nhttps:\/\/www.etsy.com\/shop\/KehoeNaturals?section_id=11961110\r\n\r\nShop Home:\r\nhttps:\/\/www.etsy.com\/shop\/KehoeNaturals?ref=si_shop\r\n\r\nShop Policies:\r\nhttps:\/\/www.etsy.com\/shop\/KehoeNaturals\/policy?ref=shopinfo_policies_leftnav",
