      "title": "Wild Man - Natural Skin Care - Aromatherapy",
      "announcement": "Welcome to Wild Rose Herbs - Innovators of unique, effective and ethically crafted natural skin care.\r\n\r\nFollow us on Instagram (@wildroseherbs), Twitter and Facebook for exclusive sales, new releases and an inside look of who we are and what we do!\r\n\r\nWild Rose is thrilled to be an Etsy featured seller! Thank you all so much for your support and kindness! Check out the feature to learn more about us: \r\nhttps:\/\/www.etsy.com\/blog\/en\/2013\/featured-shop-wild-rose-herbs\r\n\r\n**ALL IMAGES AND TEXT WITHIN THIS SHOP ARE PROTECTED UNDER COPYRIGHT LAWS AND MAY NOT BE REPRODUCED WITHOUT CONSENT** Please contact us if you&#39;d like to use our work. Thank you for your creative integrity.\r\n\r\nWild Rose strives to provide unique and natural products with maximum value and minimal waste. All products are very concentrated and made with the highest quality ingredients from suppliers with exceptional ethics. We believe in full transparency - we&#39;re proud of our products, right down to the packaging, and invite customer questions.\r\n\r\nWild Rose is our response to an economy where the ecological, political and social costs of manufacturing are veiled. Ash spends much of her time tracking down raw materials, packaging and even office supplies to their source. This minimizes or eliminates the social, environmental and ethical footprint of our products by choosing sources that are non-GMO, sustainably harvested, organic or fair trade. We grow many of the fresh botanicals needed for our recipes just outside the workshop in our organic permaculture gardens.\r\n\r\nWild Rose offsets the inevitable environmental impact of our business by donating a portion of our annual profits to environmental and social justice groups. A few of our recent donations have gone to Klamath-Siskiyou Wildlands Center, Wildlife Images, NEST, Blue Mountains Biodiversity Project, Black Mesa Indigenous Support and Units&#39;ot&#39;en Camp. Your purchase directly supports the vital work of these amazing groups!\r\n\r\nWild Rose values creative integrity and continues to set standards by offering original products you&#39;ll only find here. We thank our loyal customers for supporting our small business and investing in a sustainable future!\r\n\r\nPlease read the shop policies before ordering:\r\nhttps:\/\/www.etsy.com\/shop\/WildRoseHerbs\/policy\r\n\r\nWild Rose Herbs is also part of www.RogueArtCollective.etsy.com ",
