      "sale_message": "Thank you for ordering from Wild Rose! Your purchase directly supports our network of ethically-minded suppliers based out of the Pacific Northwest. We offset the inevitable ecological impact of our business by donating a portion of our profits to environmental protection and social justice groups. We thank you for supporting our small business and investing in a sustainable future!\r\n\r\nYou will receive an email from Etsy with tracking info just before your order ships. If you need to update your shipping address, please email or message us ASAP: info@wildroseherbs.com\r\n\r\nFollow along for an inside look at who we are and what we do (plus exclusive deals!)\r\nInstagram \/\/ Twitter @wildroseherbs\r\nwww.facebook.com\/wildroseherbs",
