      "policy_welcome": "Wild Rose makes every effort to simplify your buying experience. Please read over these store policies to ensure satisfaction with your purchase. Thank you for your interest!",
      "policy_payment": "Payment is accepted through PayPal or credit card (direct checkout) at the time of order. Once payment is received, your purchase will be shipped within three business days. Any extension of turnaround time will be announced at the top of our shop&#39;s home page. If you choose to pay by e-check, your purchase will be shipped within three business days of cleared payment.",
      "policy_shipping": "Domestic Shipping:\r\nAll orders are shipped USPS First Class Mail or Priority Mail with Delivery Confirmation. Tracking numbers are emailed through Etsy once your order has been scheduled for shipment. If you do not receive a shipping confirmation, be sure to check your junk mail folder and email us (info@wildroseherbs.com) and we can look it up. Lost orders will be refunded or reshipped at the buyer&#39;s request. Undeliverable (return to sender) orders will be cancelled and refunded less the cost of shipping. \r\n\r\nInternational Shipping:\r\nAll international orders will ship via USPS First Class Mail with insurance. Most orders arrive within two to four weeks but can take longer, especially during holidays. Cost of shipping includes insurance should your order become lost in the mail. Claims may be filed 45 days after the date of shipment. Please contact us if you do not receive your order within 45 days. Loss or damage of an order must be reported within 90 days from ship date. Shipment to Italy and Brazil require a 60 day waiting period prior to filing an insurance claim. Customs fees vary and are the sole responsibility of the buyer. Items returned for non-payment of customs fees will be refunded less the cost of shipping and fees. PLEASE NOTE: We cannot mark international items as &quot;gifts&quot; or alter the cost of goods! \r\n\r\nAll Orders:\r\nPlease allow three business days for processing time. Typical shipping days are Mondays, Wednesdays and Fridays. All items are ready to ship unless otherwise noted. Made to order items take one-two weeks to ship. A shipping date estimate for made-to-order items will be sent upon receipt. \r\n\r\nExpress shipping and insurance are available upon request.",
