      "title": "Beard Butter, Beard Oil and Beard Wash ",
      "announcement": "So, you\u2019re the Manly Man, at least you think you are and you have that Manly \r\n\r\nbeard going.  No, not the Dynasty Guys, but if you have one of those we still \r\n\r\nwant your business anyway, because you can especially use it\r\n\r\nYou know what I\u2019m talking about, a great looking beard overall.  You\u2019re good \r\n\r\nlooking, professional, women love you and you know it.  But,\u2026. Sometime that \r\n\r\nbeard gets a little itchy, out of shape and smells like yesterday\u2019s pizza lunch and \r\n\r\nsushi dinner combined.\r\n\r\nJoin our club and never look like a Robertson again. Beardcrafters is your \r\n\r\nessential beard care total package.  Turn that scraggly beard into a great \r\n\r\nsmelling, non itchy, groomed masterpiece that will have everyone saying. \r\n\r\n\u201cwow, what a manly man beard he has\u201d  \r\n\r\nBeardCrafters takes care of making sure you have all the essential beard care \r\n\r\nproducts, even a comb (that is if you can get it through the scraggly beard) and \r\n\r\nwe will automatically send you additional items each month. No matter what \r\n\r\ntype of beard you have, you have to take care of it. This is perfect for the young \r\n\r\nprofessional in you during the day, the hipster at night and the love making \r\n\r\nmachine after that date.\r\n\r\nYour first order come packed in this wonderful wood case, along with a variety \r\n\r\nof different products to include but not be inclusive of:\r\n\r\nBeard Wash: Specially formulated shampoo for those rough stumbles of beard.  \r\n\r\nGet all that old crap out of the beard and now it is fresh and clean.  No more \r\n\r\nsmelling like an old fisherman or worst yet, looking like one.\r\n\r\nBeard Oils: A dapper and dashing bearded guy needs to keep that beard soft so \r\n\r\nthat when the ladies touch it they love it and that it also smell good.  Oohh it\u2019s \r\n\r\nso soft.  There\u2019s really only one time you don\u2019t want to hear that, but it is ok \r\n\r\nwhen talking about your beard.\r\n\r\nBeard Balm:  Just like the oil and you can use one today, and the other the next \r\n\r\nday, you don\u2019t need both at one time, and it is just a matter of what you are \r\n\r\ndoing and how you want to look on that day.  This is used more for styling and if \r\n\r\nyou are going to your barbershop quartet concert than I would use this on that \r\n\r\nday and give your mustache a little twirl.\r\n\r\nNow are you ready to be that Manly Man and have that studly beard that the \r\n\r\nwomen will swoon about.",
