    "title": "Personalized Handmade Folding Wood Beard Comb",
    "description": "This is a small handmade beard comb that is crafted with bamboo scales which can be personalized with your favorite initials, nickname, or monogram. The tigerlily marble acrylic comb conveniently flips out to reveal both wide and narrow teeth to properly groom your entire beard and is appropriate for different phases of whisker growth. The smooth wood handle swivels 360 degrees, like a straight razor, to hit hard-to-reach areas and allow use with either hand while ensuring a handsome and healthy beard.\r\n\r\nMade from 5-ply alternating bamboo layers that run perpendicular to each other for strength and durability, this little comb is pretty hardy and appropriate as an everyday carry. I had one on my person while chopping firewood and shooting a Colt 1911 with a Marine Captain and a Buddhist Monk on a working cattle ranch. True story.\r\n\r\nFolds neatly into its handle and rides well in your pocket or dopp kit. Guaranteed to tame the beard on any lumberjack, ship captain, or blacksmith.  \r\n\r\nApproximately 3.6&quot; folded\r\n\r\nHandmade in Texas!\r\n\r\nWe offer FREE engraving.\r\n\r\nPlease FAVORITE our shop to keep up with newly added products.\r\n\r\nDon&#39;t see what you&#39;re looking for or have a special request? No problem. Contact us at sales@mini-Fab.com.",
