      "policy_welcome": " Can\u2019t find the perfect gift? Let\u2019s make it!\r\n\r\n\r\n\r\nHello there!\r\n\r\nWelcome to our small fabrication studio, or mini-Fab. We make interesting things for interesting people, just like you.  Here in our shop, we consider the products that we create to be our own personal pet-projects.  These are the things we think are pretty cool and we hope that you will like them too.  Our personalized products are mostly small and unique conversation pieces that will make you the envy of all your friends \u2013 If you\u2019re not already.  In which case, our wares will make a great personalized gift for that person that seems to have everything.\r\n\r\nAt heart, our mini-Fab is rooted its tradition as a classic woodshop.  Most of our items are completely handmade in Texas using traditional woodworking techniques as well as cutting-edge digital fabrication.  We have a shop full of conventional tools as well as laser cutters, CNC routers, and a 3-D printer to help make your project.  Our products are typically made out of wood, leather, cork, acrylic, and aluminum, but that doesn&#39;t stop us from experimenting with other stuff.  We try to locally source materials that are eco-friendly and sustainable, whenever possible, and try to put every last scrap to good use in order to minimize waste.  Some of our natural wood stains are made in our shop using household items such as vinegar, steel wool, hydrogen peroxide, copper, walnuts, and tea.\r\n\r\nOur products are very customizable and can be personalized with a name, monogram, logo, or just about whatever strikes your fancy.  We try our best to accommodate most requests.  Don&#39;t see what you&#39;re looking for or need help customizing one of our products?  Let us know.  We&#39;re happy to help.\r\n\r\nWe offer a 100% satisfaction guarantee and will accept returns within 14 days for a no-questions-asked-refund.  Please see our Refund Policy for more info.",
      "policy_payment": "We can accept payment by credit card or Paypal.  All items must be paid-in-full before shipping.",
      "policy_shipping": "Most things in our store are custom pieces that are made-to-order and 100% custom fabricated in our shop in Texas.  Please allow 3-5 business days to make your project, package it, and ship it out to you.  Projects will probably ship USPS Priority Mail, which has a tracking number, and will usually arrive within 1-3 days. For fastest shipping, Express 1-2 day is available and will be sent as soon as your product is finished.\r\n\r\nInternational Shipping\r\n\r\nWe love shipping stuff to international customers!  All projects will ship, when completed, by USPS First-Class Mail International and can take a few weeks to a month for delivery. For faster delivery, upgrade to Priority International Flat Rate which should arrive in 6-10 business days or choose Express for the fastest delivery of 3-5 business days. All packages will be insured and have a tracking number. All duties, taxes, and import fees are the responsibility of the customer.\r\n\r\nWe Recycle\r\n\r\nThe packing and shipping materials that your item will arrive in may contain recycled boxes and packing.  We try to do our little part and reuse as much as possible.  If you intend to send our products as a gift - directly to the recipient for instance - please let us know if you would like the fancy shipping packing. \r\n\r\nQuestions?\r\n\r\nWe would love to hear your questions, comments, or suggestions!",
      "policy_refunds": "100% Satisfaction Guarantee!\r\n\r\nWe offer a 100% satisfaction guarantee.  If, within 14 days, you are not completely pleased with your purchase.  Simply send the item back to us for a full refund, less the return shipping costs.  No questions asked.  Please contact us before shipping any items back to us to initiate a refund.  ",
      "policy_additional": null,
      "policy_seller_info": "Contact me anytime with questions or comments. Messages received after 5 PM CST Friday through Sunday will be answered the following Monday or so. Due to the volume of correspondence I receive, it can take some time to reply. I really appreciate your patience.\r\n\r\nBest,\r\n\r\n-Matt\r\n\r\nwww.mini-Fab.com\r\n\r\nhello@mini-Fab.com\r\n\r\n817.300.7678\r\n\r\n2201 Road to Six Flags\r\nArlington, TX 76004\r\n\r\n",
      "policy_updated_tsz": 1419027981,
