    "title": "Big Red Beard Comb - Cherry No.9",
    "description": "This listing is for 1 Cherry No.9 Beard Comb\r\n\r\nIntroducing the Big Red No.9. Designed with longer thicker teeth and increased spacing between them, the No.9 allows you to tackle your long, thick, curly beard with ease. As your beard grows, so does it&#39;s grooming needs. Once your beard reaches a certain length, you&#39;ll want to transition from your No.7 or No.5 to the No.9. We recommend making the transition once you&#39;ve reach medium to long beard length. Not only will the No.9 glide through with ease, it will help de-tangle those gnarly, unruly tangles.\r\n\r\nBig Red Beard Combs are crafted with a laminated technology, which ensures that your comb is made as tough as possible. The comb is made from a total of four layers, with the two inner layers, running perpendicular to the face layers to add rigidity and strength to the teeth and body of the comb. With this process we&#39;ve drastically increased the strength to ensure your comb will be around for quite some time.\r\n\r\nPlease review the dimensions below to see the true size of the comb.\r\n\r\n-    Stay Groomed Gentlemen engraving\r\n-    Cherry outer Eastern Maple inner -creating a Maple &#39;pinstripe&#39;\r\n-    Crafted with laminated technology\r\n-    Ideal for medium to long lengths\r\n-    3-5\/8&quot;(9.5cm) long x 1-1\/2&quot;(3.9cm) wide\r\n-    Static Resistant\r\n-    Protective 100% recyclable, re-seable package\r\n\r\nSold and shipped in our distinctive \u2018Big Red\u2019 packaging, you\u2019ll be impressed and relieved to find you now have a protective case for your new Big Red Beard Comb.  We care about our combs and want to ensure they see many years of use, and that is why we\u2019ve gone through the trouble of supplying cool, yet very functional packaging. Each comb is fit within it\u2019s own protective hard case and wrapped in a resealable craft paper cover. Simply remove and replace the metal rivets to open and close your package.  Everything  is well thought out, beautiful, and 100% recyclable, including the comb itself!\r\n\r\nStay Groomed Gentlemen.\r\n\r\nwww.bigredbeardcombs.com\r\n\r\nMade in Victoria, British Columbia, Canada\r\n\r\nPlease Note: Shipping does not include tracking or insurance. Please contact us if you would like to add tracking or upgrade your shipping.",
