    "description": "ALL NATURAL BEARD OIL - LARGE SIZE 50ml (2oz)\n\nFormulated with all natural ingredients, this nourishing beard oil contains Apricot Kernel Oil for beard conditioning while Jojoba Oil, Vitamin E, Rosemary, Peppermint and Lavender Essential Oils soothe and revitalize the beard and skin underneath.\n\nWith regular use, this highly nourishing oil will leave the beard soft and healthy. Great smelling too - thanks to the addition of a subtle blend of Rosemary, Peppermint and Lavender Essential Oils.\n\nNo artificial colours, fragrances or preservatives.\n\nContains:\nApricot Kernel Oil:\nA very mild natural oil. Cold pressed and refined from the dried kernels of the apricot fruit, Apricot Kernel Oil is known for its ability to penetrate the skin without leaving an oily feel. Rich in essential fatty acids like oleic and linoleic acid, Apricot Kernel Oil is also high in Vitamin A and C. The excellent softening and moisturizing properties of this oil are great for face and hair.\nJojoba Oil:\nThis naturally occurring oil is obtained from the jojoba plant, which is a perennial shrub native to northwestern Mexico and parts of California and Arizona. Jojoba Oil is widely used for the purposes of skin and hair care, mainly due to its striking similarity with that of human sebum (an oily matter naturally secreted by the oil glands present under the skin surface).\n\nHandmade in Cork, Ireland.\n\nIngredients: Apricot (Prunus Armeniaca) Kernel Oil, Jojoba (Simmondsia Chinensis) Seed Oil, Vitamin E (Tocopherol), Rosemary (Rosmarinus Officinalis) Leaf Oil, Peppermint (Mentha Piperita) Oil, Lavender (Lavendula angustifolia) Oil, *Limonene, *Linalool\n*occur naturally in essential oil\n\nContents: 50ml (approx. 2 fl. oz)\n\nFor best results, apply a a few drops 1-2 times daily, massaging throughout the beard and into the skin beneath.\n\nSHIPPING TIMES:\nI endeavour to package all products within 24-48 hours after purchase. Items are sent using the Irish Postal Service, with typical delivery times of 4-6 working days to the UK and Europe and 7-9 working days to other international destinations (US, Canada, Australia). If you require something more quickly, an Express shipping option (5 working days) is available to the UK, Europe, Australia, New Zealand, US and Canada:\nhttps:\/\/www.etsy.com\/ie\/listing\/169580881\/express-shipping-upgrade\n\nGIFTING:\nIf you are purchasing this item and would like it customised with a message and mailed directly to the recipient, please mention this in the &quot;notes to seller&quot; during checkout or send me a message by clicking here:\nhttp:\/\/www.etsy.com\/conversations\/new?with_id=15254306\n\nFAVE IT!\nIf you like this item, please don&#39;t forget to add it to your favorites by clicking the &quot;Favorite&quot; button below the &quot;Add to Cart&quot; button.\n\nTo see my full range of products, please enter my shop here:\nhttp:\/\/www.etsy.com\/shop\/drksoapcompany",
