      "title": "Dr K Soap Company",
      "announcement": "Visit Dr K on Facebook and\/or Twitter to see the latest discount coupon offers! \u2197\u2197\u2197\r\n\r\nDr K is delighted to have recently been Etsy&#39;s featured shop!\r\nhttps:\/\/blog.etsy.com\/en\/2014\/featured-shop-dr-k-soap-company\/\r\n\r\nCheck out Dr K&#39;s Instagram Feed at: http:\/\/instagram.com\/drksoapcompany\r\n\r\nA very warm welcome to my store! I&#39;m passionate about making high quality skin, hair and body care products using pure, natural ingredients. All handmade right here in Cork, Ireland.\r\n\r\nAll Dr K Soap Company products are:\r\nDetergent (SLA\/SLS\/SLES) free\r\nParaben, Phthalate and Petroleum free\r\nFree of artificial preservatives\r\nMade using natural ingredients\r\nFree of animal products (excl. beeswax, goatsmilk and honey in selected products)\r\nNot tested on animals\r\nMade from scratch using locally sourced ingredients (where possible)\r\nProduced according to EU cosmetic regulations\r\n\r\nEvery aspect of the products, from the product itself to the packaging, is assembled and\/or handmade in Ireland.\r\n\r\nI use the hot process method to make all of my soaps, ensuring a very gentle soap with excellent cleansing and lathering qualities. All soaps have a natural, rustic look, which is enhanced by the use of simple, eco-friendly packaging with natural fibers such as jute, sisal and recycled paper.\r\n\r\nIf you would like to discuss a custom order, check whether I have multiple items in stock (I usually do!) or just have a chat please don&#39;t hesitate to contact me!\r\n\r\nWhy buy natural, handmade cosmetics? Please see my article here:\r\nhttp:\/\/www.squidoo.com\/where-to-buy-natural-cosmetics\r\n\r\nI&#39;m a proud member of the Etsy Ireland Team!\r\nSearch for wonderful things on Etsy using the tag &#39;craftyirelandteam&#39;.\r\nCheck out the blog at: www.etsyireland.blogspot.com\r\n\r\nDr K Soap Company is registered with the European Soapmakers Directory and is a proud member of Cork Craft & Design and the Crafts Council of Ireland.\r\n\r\nBesides soapmaking, I have keen interests in restoring antique maps (signingstar.etsy.com), photography (viewsofireland.etsy.com) and I enjoy tinkering with vintage watch parts and making steampunk-inspired creations (professorsprocket.etsy.com).",
