    "title": "Beard Oil Sampler Set. Trial Size - 1 Dram Vegan Beard Oils. Set of 3.",
    "description": "Beard Oil Sampler Set.\n\n\/\/ This trial size set of beard oils is perfect for sampling different scents of our beard oils! Our formula is highly concentrated, so a little goes a long way. This set should last for 1-2 weeks of frequent use.\nComes packaged in a lightweight brown box, nestled in spanish moss.\n\n\nBeards of all shapes and sizes can reap the rewards of rad face fuzz with our extra hydrating oil blend, from subtle stubble to burly beard beasts! Formulated with a trio blend of oils to add softness and a healthy sheen to your beard, and moisturize the skin beneath.\n\nOur oil is a combination of hydrating jojoba oil, grapeseed and sunflower oil. Together these oils are coveted for their nourishing properties. Since they are all natural, they&#39;re gentle on your skin and beard, help to add volume and healthy shine. \n\nManly Man beard oil is light and conditioning, to hydrate your beard from inside the hair shaft, without weighing down your style. Our beard oils are highly concentrated, so a small amount is often all that is needed.\n\nThis extra hydrating blend is ideal for very dry beards + dry skin, as well as sensitive skin. It is an excellent moisturizer to protect from the harsh elements that can wreak havoc on your facial fuzz.\n\n\/\/ Our scented oils are appealing while applying, though they are subtle, so they mix well with other products.\n\n\n\/\/ Scents:\n\nPlease specify upon checkout, which 3 scents you would like. \nIf you do not choose scents, I will select at random.\n\n+ Winter Woods: A quintet of woodsy essences, this scent is a balanced blending of essential oils to create an aura of snow-covered woodland surroundings. Spruce and cedar lend a light timber scent, topped with a hint of spearmint, like a cold frost. A subtle undertone of patchouli adds in a masculine finish.\n\n+ Coffee Mocha: Warm, rich coffee, reminiscent of hot chocolate. Applying this oil in the morning is a great way to start your day, even if you are not an avid coffee drinker! The scent of coffee has been known to invigorate the senses, giving some a buzz without the bean!\n\n+ Spiced Apple: A deep apple spice, this scent is slightly zesty and savory, like hot apple cider. The scent of apples has been known to have a relaxing effect, making this the perfect I-was-at-the-cabin-this-weekend scent. Can&#39;t leave the office? Never fear - your beard, in all its spicy goodness, will be on vacay.\n\n+ Dark Forest: An unmistakably woodsy scent, Dark Forest is an earthy, masculine scent. Patchouli and palmarosa are the duo blend of essential oils that contribute to the forest inspired aroma. Palmarosa has an uplifting effect, like a brisk walk through the woods, while patchouli is an excellent tonic, and is a relaxing scent, making this duo of essential oils a perfectly balanced blend.\n\n+ Unscented: Why mess with a good thing, right? This oil lets your beard do its thing. Whether you can&#39;t tolerate scents or just consider yourself a simple dude who wants to get to the basic goodness of this nourishing beard oil without the distraction of scent, we&#39;ve got you covered. \n\n\n\/\/ Ingredients:\nALL beard oils contain the following ingredients:\n\nSunflower Oil, Jojoba Oil, Grapeseed Oil, Vegetable Glycerin, Natural Preservative\n\n\/\/ Additional ingredients:\n\nWinter Woods: Spruce Essential Oil, Cedar Essential Oil, Patchouli Essential Oil, Spearmint Essential Oil, Rosewood Essential Oil\nCoffee Mocha: Organic Coffee Extract\nSpiced Apple: Organic Spiced Apple Extract\nDark Forest: Patchouli Essential Oil, Palmarosa Essential Oil\n\n\n\/\/ Directions:\nMassage 2-4 drops into your beard. For bigger beards, you may use more drops as needed.\nWe recommend starting with a few drops, adding more as needed. A little goes a long way!\nApplying to your dry beard will help moisturize the hair and skin, and is also beneficial for softening the hair, no matter the length.\n\n\n1 dram \/ 3.7 ml each.\nPackaged in glass bottles with dropper dispensers.\nOuter packaging may vary slightly.\n\n\nFor external use only. Avoid contact with eyes. \nStore out of reach of children. Discontinue use if irritation occurs.\n\nThis information has not been evaluated by the FDA. \nThis product is not intended to diagnose, treat, cure, or prevent any disease.\n\nPlease read our shop policies before purchasing:\nhttps:\/\/www.etsy.com\/shop\/MissVioletLace\/policy",
