      "title": "Wigs - Skin and Hair Care - Hair Accessories",
      "announcement": "Shop our wigs for daily wear, scene wigs, cosplay wigs, human hair extensions, skin and hair care products, mens grooming including beard oil, mens gift sets and more!\r\n\r\nOur wigs are suitable for cosplay, scene, drag and emo style wigs, alopecia and other medical conditions, and daily wear. Unique cuts, coloring and styles provide an alternative to dyeing, bleaching and damaging your own hair. \r\n\r\n+ We also carry quartz crystal jewelry and a new line of mind + spirit salve body balms, packed with plant essences and organic extracts to moisturize and nourish skin.\r\n\r\n\r\n\/\/ Shop Policies:\r\nPlease read before making a purchase:\r\nhttps:\/\/www.etsy.com\/shop\/MissVioletLace\/policy?ref=shopinfo_policies_leftnav\r\n \r\n\r\nFacebook:\r\nNew product announcements, special sales + more\r\nhttp:\/\/www.facebook.com\/pages\/Miss-Violet-Lace\/155556851164819\r\n\r\nInstagram:\r\n@missvioletlace (instagram.com\/missvioletlace)\r\n\r\nTwitter:\r\ntwitter.com\/missvioletlace\r\n\r\nYoutube:\r\nWigs, hair, beauty + more\r\nyoutube.com\/missvioletlace\r\n\r\nBasic wig care video:\r\nStyling, how to put on, washing, storage, etc.\r\nhttp:\/\/www.youtube.com\/watch?v=WFNkLqbxChs\r\n\r\nOur wig work process:\r\nA behind-the-scenes peek of our wig work\r\nhttp:\/\/www.youtube.com\/watch?v=4HdUbeN3Jyc",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": null,
      "sale_message": "Thank you so much for supporting our shop by making a purchase, we appreciate it very much!\r\n\r\nBy purchasing from Miss Violet Lace, you are supporting our small business and helping us grow, and for that we are truly grateful.\r\n\r\n\/\/ Shipping:\r\n\r\nWigs: \r\n+ Ready to ship wigs leave our studio within 1-7 business days after date of cleared payment.\r\n+ Wigs with a longer wait time (specified in the description and shipping time of the wig) will ship within the stated time frame.\r\n+ Wig, skin and hair care and mens products ship within 2-10 business days after date of cleared payment.\r\n\r\nAll other items:\r\n+ Everything else in our shop will ship within 1-7 business days (weekends not included) after date of cleared payment, unless otherwise specified.\r\n\r\n\r\nIf you have any questions or concerns regarding your order or in general, please feel free to message me on Etsy, or email me directly at missvioletlace@yahoo.com\r\n\r\nSincerely,\r\nKrista + Sandy",
