      "login_name": "MissVioletLace",
      "accepts_custom_requests": false,
      "policy_welcome": "- Why purchase from Miss Violet Lace?\r\nWe put a lot of time and care into each and every item in our shop, and use only the finest quality materials in our work. This ensures that you will receive a long lasting item that you (or the recipient) will be able to appreciate for years to come.\r\n\r\n- How do you alter your wigs?\r\nWe hand-alter, redesign and\/or reconstruct each and every one of our wigs, giving you a stylish + glamorous alternative to dyeing, cutting and damaging your own hair. VIDEO: http:\/\/www.youtube.com\/watch?v=UdMFND2lucY \r\n\r\n",
      "policy_payment": "We accept:\r\n\r\n-  Paypal \r\n- Debit and credit cards through Paypal\r\n\r\n\/\/ Tip:\r\nAs a PayPal guest you can use your credit card, with guest checkout.\r\nI do recommend signing up for a Paypal account if you don&#39;t have one, as it offers you more payment options.\r\n\r\n+ Echecks paid through Paypal will need to clear before we ship your order.\r\n+ Minnesota residents will be charged sales tax of 7.375% upon checkout.",
      "policy_shipping": "We ship to your Paypal address only. \r\n\r\n\/\/ Processing time - Items ship after cleared payment:\r\n\r\n- Ready to ship wigs: 1-7 business days\r\n- Wigs with a longer wait time - stated time frame (generally 21-42 business days)\r\n\r\n- Skin, hair + wig care products - 2-10 business days\r\n\r\n\/\/ Tip:\r\nWe do offer shipping upgrades for most of our products if you need it sooner.\r\nKeep in mind the item will still take the same amount of our stated time frame for order processing. If you need an item sooner, please feel free to contact us before purchasing and we will try to work something out!\r\n\r\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\r\n\r\n\/\/ Lost - Stolen - Misplaced:\r\nAfter an item leaves our studio, it is out of our hands - unfortunately we cannot be held responsible for lost or stolen packages. However if you would like your order insured, please contact us before placing an order, we would be more than happy to assist you.\r\n\r\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\r\n\r\n\/\/ International shipments (outside of the U.S.):\r\n\r\n- Wig orders shipping to Australia and U.K. will ship via priority mail (unless discussed otherwise) to ensure a safe delivery.\r\n\r\n- All other international orders will ship first class mail. \r\n\r\n\/\/ Duties - Fees - Customs charges:\r\nPlease understand that we cannot be held responsible for damages or fees that may occur with international packages, so we recommend considering potential fees that may incur before placing your order, so you are prepared when it arrives in your country.\r\n\r\n- We will not honor requests to falsify customs documents.\r\n\r\n\/\/ Tracking your shipment:\r\nPlease keep in mind that tracking information for international packages will not show any information beyond the U.S., with the exception of express which usually shows more scans\/updates than standard.",
      "policy_refunds": "\/\/ All orders:\r\n\r\n- No cancellations, please. We start processing your order as soon as it&#39;s placed.\r\n- - Re: wigs: Please be sure to check our processing times on wigs before purchasing.\r\n\r\nEtsy has an option to request a cancellation, however due to how we process our orders, cancellation requests will not be processed, so please check over your order before placing it.\r\n\r\n\/\/ Returns - Exchanges - Refunds:\r\nPlease keep in mind all of our wigs, hair extensions, clip in bangs and other hair pieces are final sale, so we cannot accept returns or offer exchanges for them.\r\n\r\nHowever we want you to be happy with your MVL item(s), so if you are unsatisfied with your purchase, please contact us within 3 days of receiving your item, before leaving a review. \r\n\r\nWe are happy to work with you to come to a resolution.\r\n\r\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\r\n\r\n\/\/ Everything else - returns \/ exchanges:\r\n\r\nUnused and unopened men&#39;s + women&#39;s care products may be returned (at your expense) for a store credit or exchange. Please contact us within 7 days of delivery if you wish to return an order. \r\n\r\nUnfortunately I cannot reimburse the postage paid on the original item(s).",
      "policy_additional": "Colors may vary slightly depending on your personal computer monitor settings. \r\nWe do try our best to accurately represent colors on all of our products.\r\n\r\n\/\/ Wigs - FAQ:\r\n\r\n- Video - Basic wig care: \r\nHow to put on, wash and style your new wig, storage, etc.:\r\nhttp:\/\/www.youtube.com\/watch?v=sHL6nlMdMgo \r\n\r\n- How to measure head circumference:\r\n\r\nI recommend using a soft tape measure. Wrap the measuring tape all around your head, keeping it at your hairline from ear to ear. At the front of your head, position the measuring tape in the center of your forehead. \r\n\r\nAverage head size is more than 21 inches and less than 23 inches.\r\nSmall head sizes are 21 inches or smaller. Large head sizes are 23 inches or larger.\r\n\r\nIf you have long and\/or thick hair, we recommend selecting the large cap size option, to comfortably accommodate your natural hair under the wig.\r\n\r\n\r\n- Wig clips:\r\n\r\nWig clips are great for adding extra security to your wig. We recommend them if you plan to wear your wig daily and\/or often, or if you&#39;re a wild child jamming out at dance parties and riding rollercoasters!\r\n\r\nOur wigs should fit well without the use of clips, but are a nice addition for those who want the added security. \r\n\r\nIf you do not have natural hair, the clips will not work - they snap open, slide into your hair (underneath your wig cap), and snap closed to secure the wig to your head.",
