    "title": "No nonsense - Beard Oil 30ml 100% Organic Vegan and Ethical Freshly crafted-to-order",
    "description": "(if you give us your name and we will put it on a label free of charge!)\r\n\r\nDEEPLY CONDITIONING LIGHT BEARD OIL FOR ALL SKIN TYPES DESIGNED TO NOURISH THE FACIAL HAIR AND THE SKIN UNDERNEATH IT. \r\n\r\nCrafted with finest, pure, virgin oils: GRAPESEED, JOJOBA GOLDEN, ARGAN, CAMELLIA & SESAME and carefully selected essential oils, &quot;No Nonsense&#39; Beard Oil:\r\n\r\n- deeply moisturises and conditions your facial hair without clogging your pores\r\n- softens it and makes it easier to maintain\r\n- effectively promotes healthy hair growth\r\n- prevents split ends and breakage\r\n- soothes and rehydrates your skin\r\n- reduces the discomfort of itchy beards and dry skin\r\n- enhances elasticity\r\n- controls sebum production and restores your skin&#39;s natural healthy balance\r\n- makes your beard smell amazing ( a subtle, soft, woody tone of cedarwood and rosemary)\r\n\r\nECZEMA FRIENDLY.\r\n\r\n\r\nCEDARWOOD ESSENTIAL OIL PROPERTIES: calming and soothing effect on the mind and is of great help in conditions associated with anxiety and nervous tension\r\n\r\nROSEMARY ESSENTIAL OIL PROPERTIES: wonderful for clearing the mind and mental awareness; brain stimulant properties, as well as improving memory. It helps with headaches, migraines, neuralgia, mental fatigue and nervous exhaustion. it has also a positive effect on the health of the hair and scalp. it increases the circulation to the scalp and is therefore also effective for promoting hair growth.\r\n\r\nWe also added a tiny drop of patchouli - a reputed aphrodisiac!\r\n\r\n \r\n\r\nDIRECTIONS: AFTER A WASH, POUR A SMALL AMOUNT OF &#39;NO NONSENSE&#39; BEARD OIL INTO THE PALM OF YOUR HAND AND GENTLY WORK IT INTO YOUR STILL DAMP BEARD, MUSTACHE AND YOUR SKIN | STYLE AS NORMAL | USE DAILY.\r\n\r\n\r\n\r\n100% CERTIFIED ORGANIC, VEGAN & GUILT-FREE INGREDIENTS:\r\nCARTHAMUS TINCTORIUS, VITIS VINIFERA, SIMMONDSIA CHINENSISS, ARGANIA SPINOSA, CAMELLIA JAOPONICA, SESAMUM INDICUM, ROSMARINUS OFFICINALIS, CEDRUS ATANTICA, POGOSTEMON CABLIN, LIMONENE, LINALOOL\r\n\r\n0% WATER 0% NASTIES 0% COMPROMISES\r\n \r\n\r\n\r\n\r\n\u25ac\u25ac\u25ac\u25ac\u25ac\u25ac\u25ac\u25ac\u25ac\u25ac\u25ac\u25ac\u25ac \r\n\r\n\r\nGAIA CREAMS products should be kept in their original packaging and stored away from direct sunlight or extreme temperatures, such as a radiator, window or open door as some products can melt, if left in direct light or heat. Every GAIA CREAM  product is pure and delicate. I do not use emulsifiers or stabilizers. Iis best to apply a little bit of GAIA CREAMS cream or balm to see how much is absorbed by  your skin, and if necessary apply a little more. You will soon be able to judge the amount your skin type needs. GAIA CREAMS are especially effective if used when your skin is still warm and damp after bathing or showering.Should you need any further information, please do not hesitate to contact us.\r\n \r\nGAIA CREAMS cannot be held responsible for any deterioration of the products arising from incorrect storage or incorrect use by the customer. GAIA CREAMS do not accept responsibility for the misuse of our products. It is the responsibility of the customer to use the products with discretion. When using a product for the first time, especially if you are prone to skin allergies, GAIA CREAMS recommends that you do a test patch before use. If you have any medical concerns about using our products, some of which contain essential oils that should not be used when pregnant, lactating or with certain medical conditions, please consult your medical practitioner. Essential oils should not be used under the age of 6.\r\n\r\nWE COMPLY FULLY WITH THE NEW  EU REGULATIONS\r\n\r\n30ml",
