      "sale_message": "Thank You for your purchase.\r\nWe really appreciate you choosing Gaia Creams and are sure that your skin will too!\r\nEvery product is freshly hand-crafted to order, just for you. We will post your order within the next 7 working days and we will email you when it\u2019s been done!\r\n\r\nGaia Creams products should be kept in their original packaging and stored AWAY FROM DIRECT SUNLIGHT or extreme temperatures, such as a radiator, window or open door as some products can melt, if left in direct light or heat. Every Gaia Creams product is pure and delicate. We do not use emulsifiers or stabilizers.  If melting at any time occurs, simply place the cream in a cool place and it will harden up.  The melting will not affect the quality of the cream, but the consistency will change.\r\n\r\nIt is best to apply a little bit of Gaia Creams product to see how much is absorbed by your skin, and if necessary apply a little more. You will soon be able to judge the amount your skin type needs. Gaia Creams products are especially effective if used when your skin is still warm and damp after bathing or showering. Should you need any further information, please do not hesitate to contact us at love@gaiacreams.com.\r\n\r\n\r\nGaia Creams | Happy Yummy Skin Food\r\n\r\nPOWERFUL- RAW - 100% ORGANIC - FAIR TRADE - VEGAN \r\na l w a y s   f r e s h l y   m a d e - t o - o r d e r\r\nwww.gaiacreams.com\r\n \r\nDon&#39;t forget you can also keep up-to-date with the latest news, events and special offers through our:\r\n \r\nFACEBOOK PAGE: https:\/\/www.facebook.com\/GAIACREAMS\r\nTWITTER PAGE: https:\/\/twitter.com\/#!\/GAIACREAMS",
