    "description": "The best for your beard...we guarantee it!*\r\n\r\nMuch like our tried and tested beard balm, our new heavy duty beard balm will be the next must have for all you fellow beardos out there in competition land. We use only the finest organic oils and butters blended to perfection to create this magnificent beard control and conditioning balm. Similar to our original beard balm, but this one has a slightly thicker consistency and gives more control and softening. It&#39;s still a conditioner, so not a replacement to a wax. Tested and approved by beard teams and beard aficionados and across the country! The scent is a blend of all natural essential oils and smells like an old fashioned, pure, light, and crisp. If you like our other products, you&#39;re going to love this.\r\n\r\nComes in our new 2 ounce aluminum twist tin, we never use plastic containers. We never use petrochemicals, fragrances, or synthetic chemicals in any of our products. All products tested on willing participant humans. \r\n\r\nWho knows beards?\r\n\r\nWe know beards. Long before the current beard trend, way back before the 60&#39;s and 70&#39;s, and long before the 20th or 19th century for that matter...beards have been an integral part of Amish culture. The care for these beards have been passed through generations of men. Honest Amish Beard Products only uses premium organic ingredients, wild harvested botanicals, essential oils, and organic fruit and nut butters aimed towards the care of your beard. These original recipes were created centuries ago to help maintain, care, and control growing beards while protecting and conditioning the hair follicles. A great all natural and organic gift for any man!\r\n\r\nIf you suffer from allergies, you should always test all natural products before use to make sure you do not have a reaction. This balm has been infused with over 13 wild harvested botanicals and contains fruit and nut oils and butters.\r\n\r\nOn sale thru Father&#39;s Day, price will go back to retail after that.",
