    "description": "Are you bearded? Does it need to be tamed? Wary of store bought stuff that contains unknown chemicals?\r\n\r\nAromaman Beard Care Combo Sets, just in time for beard weather! \r\n\r\nThe 1+1 Set Includes One Each of the Following Items:\r\n\r\n- 1 ounce Beard Oil in a Cobalt Blue Bottle\r\n\r\n- 1 ounce Beard Balm in a Round Tin w\/ a Screw-top\r\n\r\n- Beard Brush\r\n\r\nThe 2+2 Set Includes One Each of the Following Items:\r\n\r\n- 2 ounce Beard Oil in an Emerald Green Bottle\r\n\r\n- 2 ounce Beard Balm in a Round Tin w\/ a Screw-top\r\n\r\n- Beard Brush\r\n\r\nThe  Love & Peace blend contains a special blend of Patchouli and Sandalwood; a pleasant woodsy\/musk scent. A popular choice for those prefer an outdoorsy scent.\r\n\r\nThe Citrus Delight blend contains Grapeseed and Jojoba carrier oils and a special blend of Grapefruit, Lemon, Sweet Orange, Lime, and Tangerine essential oils to create this wonderful aroma.\r\n\r\nThe Pumpkin Spice blend contains Sweet Almond and Jojoba carrier oils and a special blend of Nutmeg, Ginger, Clove, Cardamom & Cinnamon essential oils to create that wonderful aroma that we all love during the Autumn and Winter months.\r\n\r\nThe Bay Lime blend contains Sesame and Jojoba carrier oils and a special blend of Bay, Rosemary, Sandalwood, and Lime essential oils to create this wonderful aroma.\r\n\r\nThe Tense-Less blend contains Grapeseed and Jojoba carrier oils and a special blend of Tea Tree, Peppermint, and Eucalyptus essential oils to create this wonderful aroma.\r\n\r\n*NEW* Natural\/Unscented.\r\n\r\n*NEW* Lumberjack! This is a blend of Raw Leather musk, Cedarwood, and Pine. Months in the making and finally perfected. (Axe and Flannel shirt not included).\r\n\r\nAll Balms contain wax and shea\/cocoa butter (naturally refined, deodorized) mixture and infused with hair-healthy oils.\r\n\r\nOils also double as a shave oil. It&#39;s a very healthy alternative to chemical filled shaving creams and aftershaves. \r\n\r\nTake a dab, rub it between your hands and massage into facial hair. You&#39;ll love the shine, feel and smell of your beard.\r\n\r\nI stand behind my products. They are All-Natural and chemical free.",
