    "title": "Beard Grooming Kit - Oil, Wax, Balm, Cherry Wood comb, Ice Scissors 4.5 inch.",
    "description": "All orders sold in the U.S. or Canada will be shipped using Priority Mail and an email with tracking number will be sent AFTER the item has shipped*** 2 to 3 days U.S*** 6 to 10 days Canada***\r\nAll International shipping will NOT have Tracking information...\r\n\r\n\r\nAt Bearded Bear our mission is to provide our customers with the best, long-lasting beard grooming products that can soothe even the driest and itchiest of beards. We are constantly working to create innovative, all-natural ways of providing our customers with the best of the best in beard balms, waxes, and oils. Our products meet the highest quality standards and are 100% all natural.\r\n\r\nA little bit goes a long way!!!\r\n\r\nBeard Oil - For best results, use small dime size amounts  ( depending on length of Awesome beard) as needed to moisturize. Place hand over open bottle and shake upward once, rub hands together and apply to that sweet beard, use comb or brush to ensure oil is applied evenly through your manly beard. \r\n\r\nBeard Balm -For best results, Use after shower and dry your  rugged beard completely before use.\r\nUse thumb nail to scrape out dime size amount  (depending on length of  that sweet ass beard use larger amount), and put in palm of hand. Rub balm in hands until fully melted and apply to that  epic beard. \r\nUse Comb or brush to get balm  deep into your majestic beard hair.\r\n\r\nBeard Wax -For best results, use for styling and taming that magnificent beard and mustache down.\r\nUse thumb nail to scrape out dime size amount  (depending on length of kick ass beard and mustache use larger amount as needed). Place on tips of fingers and rub fingers and thumbs together until the wax is pliable. Apply to that sexy mustache and or problem areas of  that extravagant beard as needed.\r\n\r\nBeard care tips - \r\n 1. Do NOT comb or brush  when wet! Dry completely and do NOT use a blow dryer!\r\n 2. For curlier beards use BOAR HAIR bristle brush (available soon)!\r\n 3. I know it&#39;s difficult, but STOP pulling on that manly ass beard!!! its only going to make the hair weaker! and no body wants a weak beard!\r\n 4. If you haven&#39;t already bought some beard shampoo, BUY SOME!!! if you just don&#39;t feel like it, at least use shampoo WITHOUT alcohol... (look on the back of the bottle) head and shoulders is NOT what you want! and only shampoo 1 to 2 times per week.\r\n 5. Use scissors to trim when your incredible beard is combed down to how you like it. Trim a little at a time... and NEVER trim that magical beard when DRUNK!!! ( I did it once...  it was terrible!) Get drunk after you trim!\r\n 6. Last but not least... Take care of your beard... and it will take care of you!!!\r\n\r\nIf you have any other questions feel free to message me..\r\n\r\n\r\nAll products are lightly scented with essential oils to give it a nice clean woodsy smell.\r\n\r\n**Burlap sacks not included with grooming kit**\r\n\r\n**International shipping provided by USPS - does NOT include Tracking number.  please allow up to 4 weeks for package to arrive.** Canada excluded",
