    "title": "Merlin&#39;s Beard Wax and Oil - Beard Care Kit",
    "description": "Merlin the Wizard, teacher, adviser and council to King Arthur and the Knights of the Round Table, has been a central character in the classic Arthurian Legend for nearly a thousand years.\r\n\r\nMerlin&#39;s wisdom, guidance and mystique are what inspired us to create &quot;Merlin&#39;s Beard&quot; products.  While the tales of King Arthur of Camelot don&#39;t document Merlin&#39;s secrets for beard care, we can imagine the powerful wizard knew how to care for the outward symbol of his wisdom, his beard.\r\n\r\nMerlin&#39;s beard care secrets are what we&#39;ve tried to (re)create.  Since we can&#39;t use magic, we&#39;ve worked hard to create products using all natural ingredients that work like magic to grow and maintain a healthy beard. \r\n\r\nOur classic, all natural beard wax is a versatile product that provides medium hold to help tame unruly hairs without feeling heavy and uncomfortable.  The addition of shea and cocoa butters help to soften and condition your beard.\r\n\r\nThis 1 wax and 1 oil beard care kit gives you everything you need to maintain a healthy beard.  You will receive a tin of  beard wax in the scent of your choice along with a bottle of our naturally scented (no added essential oils) beard oil.   \r\n\r\nFor best results: \r\n\r\nOil:\r\nPlace desired amount in palm (5-10 drops depending on beard size), rub between palms and apply upward into freshly washed, damp beard. Comb through to coat evenly. Apply daily after shower.\r\n\r\nWax:\r\nUsing thumbnail, scrape desired amount onto back of thumb.  Gently work into palms to warm.  Apply to clean beard and comb through.  Re-apply as desired.\r\n\r\nBeard Oil Ingredients:\r\nAvocado oil\r\nSweet almond oil\r\nApricot kernel oil\r\nSunflower oil\r\nWheat Germ oil\r\nVitamin E oil\r\nJojoba oil\r\n\r\nBeard Wax Ingredients:\r\nBees wax\r\nShea butter\r\nCocoa butter\r\nSweet almond oil\r\nApricot kernel oil",
